import React, { useState } from 'react';

const RegistroPersona = () => {
  const [nombre, setNombre] = useState('');
  const [apellido, setApellido] = useState('');
  const [email, setEmail] = useState('');
  const [identificacion, setIdentificacion] = useState('');
  const [fechaNacimiento, setFechaNacimiento] = useState('');
  const [usuario, setUsuario] = useState({ login: '', password: '' });
  const [modalMessage, setModalMessage] = useState('');
  const [modalType, setModalType] = useState(''); // 'success' o 'error'
  const [showModal, setShowModal] = useState(false);

  const handleCloseModal = () => setShowModal(false);

  const handleSubmit = (e) => {
    e.preventDefault();

    // Validar que se complete la fecha de nacimiento (puedes agregar más validaciones aquí)
    if (!fechaNacimiento) {
      setModalMessage('La fecha de nacimiento es obligatoria.');
      setModalType('error');
      setShowModal(true);
      return;
    }

    const dataToSend = {
      nombre,
      apellido,
      email,
      identificacion,
      fechaNacimiento,
      usuario,
    };

    fetch("http://localhost:9001/Laboratorio1/persona", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(dataToSend),
    })
      .then((response) => {
        if (response.ok) {
          return response.json(); // Esto manejará el estado 201
        } else {
          return response.json().then((err) => {
            throw new Error(err.message || "Error en la solicitud.");
          });
        }
      })
      .then((data) => {
        // Manejo de éxito
        setModalMessage(data); // Asignar el mensaje de éxito
        setModalType("success");
        setShowModal(true);
      })
      .catch((error) => {
        console.error("Error:", error);
        setModalMessage(error.message); // Asignar el mensaje de error
        setModalType("error");
        setShowModal(true);
      });
  };

  return (
    <div className="container">
      <h2>Registro de Persona</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Nombre:</label>
          <input
            type="text"
            className="form-control"
            value={nombre}
            onChange={(e) => setNombre(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label>Apellido:</label>
          <input
            type="text"
            className="form-control"
            value={apellido}
            onChange={(e) => setApellido(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label>Email:</label>
          <input
            type="email"
            className="form-control"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label>Identificación:</label>
          <input
            type="text"
            className="form-control"
            value={identificacion}
            onChange={(e) => setIdentificacion(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label>Fecha de Nacimiento:</label>
          <input
            type="date"
            className="form-control"
            value={fechaNacimiento}
            onChange={(e) => setFechaNacimiento(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label>Usuario:</label>
          <input
            type="text"
            className="form-control"
            value={usuario.login}
            onChange={(e) => setUsuario({ ...usuario, login: e.target.value })}
            required
          />
        </div>
        <div className="form-group">
          <label>Contraseña:</label>
          <input
            type="password"
            className="form-control"
            value={usuario.password}
            onChange={(e) => setUsuario({ ...usuario, password: e.target.value })}
            required
          />
        </div>
        <button type="submit" className="btn btn-primary">Registrar</button>
      </form>

      {/* Modal para mensajes */}
      {showModal && (
        <div className={`modal fade show`} style={{ display: 'block' }}>
          <div className="modal-dialog">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">{modalType === 'success' ? 'Éxito' : 'Error'}</h5>
                <button type="button" className="close" onClick={handleCloseModal}>
                  <span>&times;</span>
                </button>
              </div>
              <div className="modal-body">
                <p>{modalMessage}</p>
              </div>
              <div className="modal-footer">
                <button type="button" className="btn btn-secondary" onClick={handleCloseModal}>
                  Cerrar
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default RegistroPersona;
